import { Navigate } from "react-router-dom";
const Register = () => {
    const click = () => {
        if(click) {
            <Navigate to="/login"/>
        }
        else {
            return
        }
    }
    return ( 
        <div>
        <h2>testeee</h2>
        <button onClick={click}></button>
        </div>
     );
}
 
export default Register;
